import React from "react";

export default function Search() {
  return (
    <body>
      <header>
        <form action="" class="searchbar">
          <input type="text" placeholder="Look for yummy recipes!" />
          <button type="submit">
            <i class="fa-solid fa-magnifying-glass"></i>
          </button>
        </form>
      </header>
    </body>
  );
}
